        public PrimerNivelCalidadProducto(double valorFiabilidad, double valorFuncionalidad, double valorEficiencia, double valorUsabilidad)
        {
            this.valorFiabilidad = valorFiabilidad;
            this.valorFuncionalidad = valorFuncionalidad;
            this.valorEficiencia = valorEficiencia;
            this.valorUsabilidad = valorUsabilidad;
        }

        public double obtenerCalidadProducto ()
        {
            if (_fsCalidadProducto == null)
            {
                _fsCalidadProducto = CrearSistemaCalidadProducto();
                if (_fsCalidadProducto == null)
                {
                    return -1;
                }
            }

            FuzzyVariable fvFiabilidad = _fsCalidadProducto.InputByName("fiabilidad");
            FuzzyVariable fvFuncionalidad = _fsCalidadProducto.InputByName("funcionalidad");
            FuzzyVariable fvEficiencia = _fsCalidadProducto.InputByName("eficiencia");
            FuzzyVariable fvUsabilidad = _fsCalidadProducto.InputByName("usabilidad");

            FuzzyVariable fvCalidadProducto = _fsCalidadProducto.OutputByName("calidad_producto");



            //
            // Associate input values with input variables
            //
            Dictionary<FuzzyVariable, double> inputValues = new Dictionary<FuzzyVariable, double>();
            inputValues.Add(fvFiabilidad, valorFiabilidad);
            inputValues.Add(fvFuncionalidad, valorFuncionalidad);
            inputValues.Add(fvEficiencia, valorEficiencia);
            inputValues.Add(fvUsabilidad, valorUsabilidad);

            //
            // Calculate result: one output value for each output variable
            //
            Dictionary<FuzzyVariable, double> result = _fsCalidadProducto.Calculate(inputValues);

            //
            // Get output value for the 'tips' variable
            //
            if (result[fvCalidadProducto].ToString("f1").Equals("NeuN"))
            {
                Console.WriteLine("ESTA MALO EL VALOR DE CALIDAD DE PRODUCTO");
                return -1;
            }
            else
            {
                return result[fvCalidadProducto];
            }
        }
    }
